data:
  definition: mouvement périodique d'un conducteur produit par le vent, principalement
    dans un plan vertical, à une fréquence relativement élevée de l'ordre d'une dizaine
    à quelques dizaines de Hz, et d'amplitude relativement faible de l'ordre de grandeur
    du diamètre du conducteur
  examples: []
  notes: []
